import React, {useState, useEffect} from 'react';
import DoggoList from './DoggoList';
import RegisterButton from './RegisterButton.js';
import axios from 'axios';

function DoggoApp () {
  const [doggoData, setDoggoData] = useState ({data: []});

  useEffect (() => {
    const fetchData = async () => {
      const result = await axios (
        'https://dogfair.herokuapp.com/api/license_registrations'
      );
      setDoggoData (result.doggoData);
    };
    fetchData ();
  }, []);

  return (
    <div
      className="container"
      style={{paddingTop: '1em', paddingBottom: '1em'}}
    >
      <RegisterButton btnName="Register a new doggo" btnColor="is-info" />

      {doggoData.data.map (item => (
        <DoggoList
          key="item.id"
          doggoName={item.name}
          doggoAge="5"
          doggoId="J...546L"
          doggoDescription="Yes shiba inu is one of the cutest doggo in the world"
        />
      ))}

      {/* <DoggoList
        doggoName="Husky aka moonmoon"
        doggoAge="3"
        doggoId="J...324P"
        doggoDescription="Moonmoon is also famous on the internet and they like to howl to their hooman"
      /> */}

    </div>
  );
}

export default DoggoApp;
